        public static string SqlReaderToJson(SqlDataReader rdr)
        {
            StringBuilder sb = new StringBuilder();
            StringWriter sw = new StringWriter(sb);

            using (JsonWriter jsonWriter = new JsonTextWriter(sw))
            {
                jsonWriter.WriteStartArray();

                while (rdr.Read())
                {
                    jsonWriter.WriteStartObject();

                    int fields = rdr.FieldCount;

                    for (int i = 0; i < fields; i++)
                    {
                        jsonWriter.WritePropertyName(rdr.GetName(i));
                        jsonWriter.WriteValue(rdr[i]);
                    }

                    jsonWriter.WriteEndObject();
                }

                jsonWriter.WriteEndArray();

                return sw.ToString();
            }
        }

        public static string ObtenerExtensionImagenBase64(string imagen64)
        {
            string extension = string.Empty;
            int position = 0;

            position = imagen64.IndexOf("iVBOR");
            if (position == 0)
                return extension = "image/png";

            position = imagen64.IndexOf("/9j/4");
            if (position == 0)
                return extension = "image/jpeg";

            //bmp de 256 colores
            position = imagen64.IndexOf("Qk3");
            if (position == 0)
                return extension = "image/bmp";

            //bmp de monocromatico colores
            position = imagen64.IndexOf("Qk2");
            if (position == 0)
                return extension = "image/bmp";

            //bmp de 16 colores
            position = imagen64.IndexOf("Qk1");
            if (position == 0)
                return extension = "image/bmp";

            return extension;
        }

        public static IEnumerable<ErrorModelState> AllErrors(this ModelStateDictionary modelState)
        {
            var result = from ms in modelState
                where ms.Value.Errors.Any()
                let fieldKey = ms.Key
                let errors = ms.Value.Errors
                from error in errors
                select new ErrorModelState(fieldKey, error.ErrorMessage);

            return result;
        }

        public static Image ImageBase64ToImage(string imageBase64)
        {
            byte[] bytes = Convert.FromBase64String(imageBase64);

            Image image;
            using (MemoryStream ms = new MemoryStream(bytes))
            {
                image = Image.FromStream(ms);
            }

            return image;
        }

        public static string NumeroALetras(this decimal numberAsString)
        {
            string dec;

            var entero = Convert.ToInt64(Math.Truncate(numberAsString));
            var decimales = Convert.ToInt32(Math.Round((numberAsString - entero) * 100, 2));
            if (decimales > 0)
            {
                //dec = " PESOS CON " + decimales.ToString() + "/100";
                dec = $" PESOS {decimales:0,0} /100";
            }
            //Código agregado por mí
            else
            {
                //dec = " PESOS CON " + decimales.ToString() + "/100";
                dec = $" PESOS {decimales:0,0} /100";
            }

            var res = NumeroALetras(Convert.ToDouble(entero)) + dec;
            return res;
        }

        [SuppressMessage("ReSharper", "CompareOfFloatsByEqualityOperator")]
        private static string NumeroALetras(double value)
        {
            string num2Text;
            value = Math.Truncate(value);
            if (value == 0) num2Text = "CERO";
            else if (value == 1) num2Text = "UNO";
            else if (value == 2) num2Text = "DOS";
            else if (value == 3) num2Text = "TRES";
            else if (value == 4) num2Text = "CUATRO";
            else if (value == 5) num2Text = "CINCO";
            else if (value == 6) num2Text = "SEIS";
            else if (value == 7) num2Text = "SIETE";
            else if (value == 8) num2Text = "OCHO";
            else if (value == 9) num2Text = "NUEVE";
            else if (value == 10) num2Text = "DIEZ";
            else if (value == 11) num2Text = "ONCE";
            else if (value == 12) num2Text = "DOCE";
            else if (value == 13) num2Text = "TRECE";
            else if (value == 14) num2Text = "CATORCE";
            else if (value == 15) num2Text = "QUINCE";
            else if (value < 20) num2Text = "DIECI" + NumeroALetras(value - 10);
            else if (value == 20) num2Text = "VEINTE";
            else if (value < 30) num2Text = "VEINTI" + NumeroALetras(value - 20);
            else if (value == 30) num2Text = "TREINTA";
            else if (value == 40) num2Text = "CUARENTA";
            else if (value == 50) num2Text = "CINCUENTA";
            else if (value == 60) num2Text = "SESENTA";
            else if (value == 70) num2Text = "SETENTA";
            else if (value == 80) num2Text = "OCHENTA";
            else if (value == 90) num2Text = "NOVENTA";
            else if (value < 100)
                num2Text = NumeroALetras(Math.Truncate(value / 10) * 10) + " Y " + NumeroALetras(value % 10);
            else if (value == 100) num2Text = "CIEN";
            else if (value < 200) num2Text = "CIENTO " + NumeroALetras(value - 100);
            else if ((value == 200) || (value == 300) || (value == 400) || (value == 600) || (value == 800))
                num2Text = NumeroALetras(Math.Truncate(value / 100)) + "CIENTOS";
            else if (value == 500) num2Text = "QUINIENTOS";
            else if (value == 700) num2Text = "SETECIENTOS";
            else if (value == 900) num2Text = "NOVECIENTOS";
            else if (value < 1000)
                num2Text = NumeroALetras(Math.Truncate(value / 100) * 100) + " " + NumeroALetras(value % 100);
            else if (value == 1000) num2Text = "MIL";
            else if (value < 2000) num2Text = "MIL " + NumeroALetras(value % 1000);
            else if (value < 1000000)
            {
                num2Text = NumeroALetras(Math.Truncate(value / 1000)) + " MIL";
                if ((value % 1000) > 0)
                {
                    num2Text = num2Text + " " + NumeroALetras(value % 1000);
                }
            }
            else if (value == 1000000)
            {
                num2Text = "UN MILLON";
            }
            else if (value < 2000000)
            {
                num2Text = "UN MILLON " + NumeroALetras(value % 1000000);
            }
            else if (value < 1000000000000)
            {
                num2Text = NumeroALetras(Math.Truncate(value / 1000000)) + " MILLONES ";
                if ((value - Math.Truncate(value / 1000000) * 1000000) > 0)
                {
                    num2Text = num2Text + " " + NumeroALetras(value - Math.Truncate(value / 1000000) * 1000000);
                }
            }
            else if (value == 1000000000000) num2Text = "UN BILLON";
            else if (value < 2000000000000)
                num2Text = "UN BILLON " + NumeroALetras(value - Math.Truncate(value / 1000000000000) * 1000000000000);
            else
            {
                num2Text = NumeroALetras(Math.Truncate(value / 1000000000000)) + " BILLONES";
                if ((value - Math.Truncate(value / 1000000000000) * 1000000000000) > 0)
                {
                    num2Text = num2Text + " " +
                               NumeroALetras(value - Math.Truncate(value / 1000000000000) * 1000000000000);
                }
            }

            return num2Text;
        }

        public static string StringToMoneda_MX(string cadena)
        {
            try
            {
                if (string.IsNullOrEmpty(cadena))
                {
                    cadena = "0";
                }

                CultureInfo MX = new CultureInfo("es-MX");
                cadena = float.Parse(cadena).ToString("C", MX);
                return cadena;
            }
            catch (Exception)
            {

                throw;
            }
        }

        public static string StringToKilos(string cadena)
        {
            try
            {
                if (string.IsNullOrEmpty(cadena))
                {
                    cadena = "0";
                }

                cadena = string.Format("{0:n}", float.Parse(cadena));
                cadena = cadena + " kg";
                return cadena;
            }
            catch (Exception)
            {

                throw;
            }
        }

        public static DatosGeneralesGanados ObtenerDatosGeneralesGanado(DatosGeneralesGanados datos,
            List<ReporteGanadoModels> lista)
        {
            try
            {
                string macho = "MACHO";
                string hembra = "HEMBRA";
                datos.TotalGanadoMachos = 0;
                datos.TotalGanadoHembras = 0;
                datos.TotalGanados = 0;
                datos.TotalKilosGanadoMachos = 0;
                datos.TotalKilosGanadoHembras = 0;
                datos.TotalKilosGanados = 0;
                decimal pesoInicialConvertido = 0;
                decimal pesoInicial = 0;
                decimal pesoFinalConvertido = 0;
                decimal pesoFinal = 0;
                decimal pesoInicialMachos = 0;
                decimal pesoInicialHembras = 0;
                decimal pesoFinalMachos = 0;
                decimal pesoFinalHembras = 0;


                for (int i = 0; i < lista.Count; i++)
                {
                    string[] pesoStringInicial = lista[i].PesoInicial.Split(' ');
                    string[] pesoStringFinal = lista[i].PesoFinal.Split(' ');

                    if (string.Equals(lista[i].Genero.Trim(), macho))
                    {

                        datos.TotalGanadoMachos += 1;
                        pesoStringInicial = lista[i].PesoInicial.Split(' ');
                        pesoStringFinal = lista[i].PesoFinal.Split(' ');

                        if (decimal.TryParse(pesoStringInicial[0], out pesoInicialConvertido))
                        {
                            pesoInicialMachos += pesoInicialConvertido;
                        }
                        else
                        {
                            pesoInicialMachos += 0;
                        }

                        if (lista[i].Repeso)
                        {
                            if (decimal.TryParse(pesoStringFinal[0], out pesoFinalConvertido))
                            {
                                datos.TotalKilosGanadoMachos += pesoFinalConvertido;
                                pesoFinal += pesoFinalConvertido;
                                pesoFinalMachos += pesoFinalConvertido;
                            }
                            else
                            {
                                datos.TotalKilosGanadoMachos += 0;
                                pesoFinal += 0;
                                pesoFinalMachos += 0;
                            }
                        }
                        else
                        {
                            if (decimal.TryParse(pesoStringInicial[0], out pesoFinalConvertido))
                            {
                                datos.TotalKilosGanadoMachos += pesoFinalConvertido;
                                pesoFinal += pesoFinalConvertido;
                                pesoFinalMachos += pesoFinalConvertido;
                            }
                            else
                            {
                                datos.TotalKilosGanadoMachos += 0;
                                pesoFinal += 0;
                                pesoFinalMachos += 0;
                            }
                        }
                    }
                    else if (string.Equals(lista[i].Genero.Trim(), hembra))
                    {
                        datos.TotalGanadoHembras += 1;
                        pesoStringInicial = lista[i].PesoInicial.Split(' ');
                        pesoStringFinal = lista[i].PesoFinal.Split(' ');

                        if (decimal.TryParse(pesoStringInicial[0], out pesoInicialConvertido))
                        {
                            pesoInicialHembras += pesoInicialConvertido;
                        }
                        else
                        {
                            pesoInicialHembras += 0;
                        }

                        if (lista[i].Repeso)
                        {
                            if (decimal.TryParse(pesoStringFinal[0], out pesoFinalConvertido))
                            {
                                datos.TotalKilosGanadoHembras += pesoFinalConvertido;
                                pesoFinal += pesoFinalConvertido;
                                pesoFinalHembras += pesoFinalConvertido;
                            }
                            else
                            {
                                datos.TotalKilosGanadoHembras += 0;
                                pesoFinal += 0;
                                pesoFinalHembras += 0;
                            }
                        }
                        else
                        {
                            if (decimal.TryParse(pesoStringInicial[0], out pesoFinalConvertido))
                            {
                                datos.TotalKilosGanadoHembras += pesoFinalConvertido;
                                pesoFinal += pesoFinalConvertido;
                                pesoFinalHembras += pesoFinalConvertido;
                            }
                            else
                            {
                                datos.TotalKilosGanadoHembras += 0;
                                pesoFinal += 0;
                                pesoFinalHembras += 0;
                            }
                        }
                    }
                }

                if (datos.TotalGanadoMachos != 0)
                {
                    datos.TotalMermaGanadoMachos = (((pesoFinalMachos * 100) / pesoInicialMachos) - 100) * (-1);
                    datos.TotalMermaGanadoMachos = Decimal.Round(datos.TotalMermaGanadoMachos, 2);
                    datos.StringTotalMermaGanadoMachos = datos.TotalMermaGanadoMachos.ToString() + " %";
                    datos.StringTotalKilosGanadoMachos = datos.TotalKilosGanadoMachos.ToString() + " kg";

                }
                else
                {
                    datos.StringTotalKilosGanadoMachos = "0 kg";
                    datos.StringTotalMermaGanadoMachos = "0.00 %";
                }

                if (datos.TotalGanadoHembras != 0)
                {
                    datos.TotalMermaGanadoHembras = (((pesoFinalHembras * 100) / pesoInicialHembras) - 100) * (-1);
                    datos.TotalMermaGanadoHembras = Decimal.Round(datos.TotalMermaGanadoHembras, 2);
                    datos.StringTotalMermaGanadoHembras = datos.TotalMermaGanadoHembras.ToString() + " %";
                    datos.StringTotalKilosGanadoHembras = datos.TotalKilosGanadoHembras.ToString() + " kg";
                }
                else
                {
                    datos.StringTotalKilosGanadoHembras = "0 kg";
                    datos.StringTotalMermaGanadoHembras = "0.00 %";
                }

                datos.TotalGanados = datos.TotalGanadoMachos + datos.TotalGanadoHembras;

                if (datos.TotalGanados != 0)
                {
                    pesoInicial = pesoInicialMachos + pesoInicialHembras;
                    datos.TotalMermaGanados = (((pesoFinal * 100) / pesoInicial) - 100) * (-1);
                    datos.TotalMermaGanados = Decimal.Round(datos.TotalMermaGanados, 2);
                    datos.StringTotalMermaGanados = datos.TotalMermaGanados.ToString() + " %";
                    datos.StringTotalKilosGanados =
                        (datos.TotalKilosGanadoMachos + datos.TotalKilosGanadoHembras).ToString() + " kg";
                }
                else
                {
                    datos.StringTotalKilosGanados = "0 kg";
                    datos.StringTotalMermaGanados = "0.00 %";
                }

                return datos;
            }
            catch (Exception)
            {
                throw;
            }
        }

        public static Bitmap ProcessFile(Stream oStream)
        {
            oStream.Position = 0;

            MagickImage image = new MagickImage(oStream);

            Bitmap bmp = image.ToBitmap(ImageFormat.Png);

            oStream.Close();
            oStream.Dispose();

            return bmp;
        }

        public static string FileMapPath(string fileName, string baseDir)
        {
            string filePath;
            var urlRelative = baseDir + fileName;
            try
            {
                var path = HostingEnvironment.MapPath(urlRelative);

                if (File.Exists(path) && !string.IsNullOrWhiteSpace(fileName))
                {
                    filePath = "file:///" + HostingEnvironment.MapPath(urlRelative);
                }
                else
                {
                    filePath = "file:///" + HostingEnvironment.MapPath(ProjectSettings.PathDefaultImage);
                }
            }
            catch (Exception)
            {
                filePath = "file:///" + HostingEnvironment.MapPath(ProjectSettings.PathDefaultImage);
            }
            return filePath;

        }
